var img =
"data:image/png;base64,";


function numberToWords(num) {
  const a = [
    "", "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine", "Ten", 
    "Eleven", "Twelve", "Thirteen", "Fourteen", "Fifteen", "Sixteen", 
    "Seventeen", "Eighteen", "Nineteen"
  ];
  const b = [
    "", "", "Twenty", "Thirty", "Forty", "Fifty", "Sixty", "Seventy", "Eighty", "Ninety"
  ];

  if (num === 0) return "Zero";
  if (num < 20) return a[num];
  if (num < 100) return b[Math.floor(num / 10)] + (num % 10 !== 0 ? " " + a[num % 10] : "");
  if (num < 1000) return a[Math.floor(num / 100)] + " Hundred" + (num % 100 !== 0 ? " " + numberToWords(num % 100) : "");
  if (num < 1000000) return numberToWords(Math.floor(num / 1000)) + " Thousand" + (num % 1000 !== 0 ? " " + numberToWords(num % 1000) : "");

  return "Number too large";
}




async function generatePDF() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  const pageWidth = doc.internal.pageSize.getWidth();
  const imgWidth = 70;
  const imgHeight = 20;
  const xImg = (pageWidth - imgWidth) / 2;
  const yImg = 5;

  doc.addImage(img, "PNG", xImg, yImg, imgWidth, imgHeight);
  doc.setFontSize(12);
  doc.setFont("Helvetica", "normal");
  doc.text("Poblacion, Dumanjug, Cebu", pageWidth / 2, yImg + imgHeight + 6, {
    align: "center",
  });
  doc.text("qm_builders@yahoo.com", pageWidth / 2, yImg + imgHeight + 12, {
    align: "center",
  });
  doc.text("(032) 471 9103", pageWidth / 2, yImg + imgHeight + 18, {
    align: "center",
  });
  const now = new Date();
  const dateTimeStr = now.toLocaleString();
  // Add date/time text aligned to right corner, just below the phone number
  const yDateTime = yImg + imgHeight + 24; // 6 units below phone number
  doc.setFontSize(10);
  doc.text("DATE: " + dateTimeStr, pageWidth - 10, yDateTime, {
    align: "right",
  });

  const rectY = yDateTime + 6; // 6 mm below date/time

  doc.setFillColor(211, 211, 211); // Light gray
  doc.rect(15, rectY, 180, 10, "F");

  doc.setFontSize(14);
  doc.setFont("Helvetica", "bold");
  doc.text("BILLING STATEMENT", pageWidth / 2, rectY + 7, { align: "center" });

  // Adjust Y positions
  const billingNumberY = rectY + 18; // top-right label
  const billToY = rectY + 25; // "BILL TO" row
  const addressY = billToY + 8; // line below for address

  doc.setFontSize(10);
  doc.setFont("Helvetica", "normal");

  // --- RIGHT SIDE: BILLING NUMBER ---
  doc.text("BILLING NUMBER", 195, billingNumberY, { align: "right" });
  doc.text("QM-8881-0425-1", 195, billToY, { align: "right" });

  // --- LEFT SIDE: BILL TO and ME ---
  doc.text("BILL TO:", 20, billToY);

  // Underline for "ME"
  const underlineStartX = 50;
  const underlineEndX = 120;
  const underlineY = billToY + 1;

  doc.line(underlineStartX, underlineY, underlineEndX, underlineY);

  const meText = "ME";
  const name = document.getElementById("client-name")?.innerText || "";
  const meWidth = doc.getTextWidth(meText);
  const meX = underlineStartX  + 10;

  doc.setFont("Helvetica", "bold");
  doc.text(`${name.toUpperCase()}`, meX , billToY);

  doc.setFont("Helvetica", "normal");

  // --- ADDRESS SECTION (below) ---
  doc.text("ADDRESS:", 20, addressY);

  // Draw matching underline for address
  doc.line(underlineStartX, addressY + 1, underlineEndX, addressY + 1);

  // Y position after ADDRESS section
  const infoStartY = addressY + 10;

  // --- Italic line ---
  doc.setFontSize(10);
  doc.setFont("Helvetica", "italic");
  doc.text("This is to bill you for the following:", 20, infoStartY);

  // --- Reset to normal font ---
  doc.setFont("Helvetica", "normal");

  // Indented details
  const labelX = 30;
  const valueX = 65;

  doc.text("AIRCRAFT:", labelX, infoStartY + 7);
  doc.text("RP-C8851 BELL 505", valueX, infoStartY + 7);

  const dateSched = document.getElementById("date-sched")?.innerText || "";
  doc.text("FLIGHT DATE:", labelX, infoStartY + 14);
  doc.text(`${dateSched}`, valueX, infoStartY + 14);

  const location = document.getElementById("location")?.innerText || "";
  doc.text("FLIGHT ROUTE:", labelX, infoStartY + 21);
  doc.text(`${location}`, valueX, infoStartY + 21);

  // Table setup
  // const pageWidth = doc.internal.pageSize.getWidth();
  const marginLeft = 20;
  const marginRight = 20;

  const descWidth = 130;
  const amountWidth = 40;
  const tableWidth = descWidth + amountWidth;
  const tableStartX = (pageWidth - tableWidth) / 2;

  const tableStartY = infoStartY + 27;
  const rowHeight = 8;

  // Header row
  doc.setFontSize(10);
  doc.setFont("Helvetica", "bold");
  doc.text("DESCRIPTION", tableStartX + 2, tableStartY + 6);
  doc.text(
    "AMOUNT",
    tableStartX + descWidth + amountWidth - 2,
    tableStartY + 6,
    { align: "right" }
  );

  // Draw header rectangle
  doc.rect(tableStartX, tableStartY, tableWidth, rowHeight);

  // Reset font for rows
  doc.setFont("Helvetica", "normal");

  const pay = 65000 / 60;

  // Helper: clean the amount
  function cleanNumber(text) {
    return Number(
      (text || "0").replace(/[^\d.-]/g, "") // remove anything that's not digit, dot or minus
    );
  }
  
  // Read and clean the values
  const blockTime = cleanNumber(document.getElementById("block-time")?.innerText);
  const landingFee = cleanNumber(document.getElementById("landing-fee")?.innerText);
  const terminalFee = cleanNumber(document.getElementById("terminal-fee")?.innerText);
  
  const addCycleText = document.getElementById("add-cycle")?.innerText.trim() || "0";
  let addCycle = 0;
  
  // Only convert if it's a number, otherwise 0
  if (!isNaN(Number(addCycleText))) {
    addCycle = Number(addCycleText);
  }
  
  // Clean total billed
  const totalBilled = cleanNumber(document.getElementById("total-billed")?.innerText);
  
  // Compute additional cycle amount
  let amountAddCycle;
  if (addCycle == 1) {
    amountAddCycle = 1000;
  } else if (addCycle > 1) {
    amountAddCycle = (addCycle - 1) * 2000 + 1000;
  } else {
    amountAddCycle = 0;
  }
  
  // Data rows
  const rows = [
    ["TOTAL BLOCK TIME", (blockTime * pay).toFixed(2)],
    ["TAKE-OFF & LANDING FEE", (landingFee * 5000).toFixed(2)],
    ["ADDITIONAL CYCLE/S", amountAddCycle.toFixed(2)],
    ["TERMINAL FEE", terminalFee.toFixed(2)],
    ["TOTAL AMOUNT DUE", totalBilled.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 2 })],
  ];
  
  
  // Draw rows with lines
  rows.forEach((row, i) => {
    const y = tableStartY + rowHeight * (i + 1);

    // Draw row rectangle
    doc.rect(tableStartX, y, tableWidth, rowHeight);

    // Description (left padding 2)
    doc.text(row[0], tableStartX + 2, y + 6);

    // Amount (right aligned with padding 2)
    doc.text(row[1], tableStartX + descWidth + amountWidth - 2, y + 6, {
      align: "right",
    });
  });

  // Draw vertical line separating columns (for entire table height)
  const tableHeight = rowHeight * (rows.length + 1); // header + data rows
  doc.line(
    tableStartX + descWidth,
    tableStartY,
    tableStartX + descWidth,
    tableStartY + tableHeight
  );

  //das

  const boxX = marginLeft;
  const boxWidth = pageWidth - marginLeft - marginRight;
  const boxHeight = 18; // smaller box height
  const amountWordsY = tableStartY + (rows.length + 1) * rowHeight + 4; // closer to table

  // Calculate center X for the box
  const centerX = boxX + boxWidth / 2;

  doc.rect(boxX, amountWordsY, boxWidth, boxHeight);

  doc.setFontSize(10);
  doc.setFont("Helvetica", "normal");
  doc.text("AMOUNT IN WORDS:", boxX + 5, amountWordsY + 6);

  doc.setFont("Helvetica", "bold");
  doc.setFontSize(12);
  doc.text(`** ${numberToWords(totalBilled)} Pesos Only **`, centerX, amountWordsY + 14, {
    align: "center",
  });

  const afterBoxY = amountWordsY + boxHeight + 6; // space after the box
  const indent = 40; // 4 indentations (~10 units each)
  const leftMargin = marginLeft;
  const rightMargin = pageWidth - marginLeft;

  // --- Note label and text ---
  doc.setFontSize(10);
  doc.setFont("Helvetica", "bolditalic");

  // "Note:" left corner
  doc.text("Note:", leftMargin, afterBoxY);

  // "Please make check payable to" next to "Note:"
  doc.text("Please make check payable to", leftMargin + 20, afterBoxY);

  // --- Indented Account Details below note ---
  const accountStartY = afterBoxY + 7;

  doc.text("Account Name:", leftMargin + indent, accountStartY);
  doc.text("QM BUILDERS", leftMargin + indent + 70, accountStartY);

  doc.text("Account No:", leftMargin + indent, accountStartY + 7);
  doc.text("Bank Name:", leftMargin + indent, accountStartY + 14);
  doc.setTextColor(255, 0, 0);
  doc.text("013228005865", leftMargin + indent + 70, accountStartY + 7);
  doc.text("BANCO DE ORO (BDO)", leftMargin + indent + 70, accountStartY + 14);
  doc.setTextColor(0, 0, 0);
  // --- DUE DATE and Due Immediately on left corner below account details ---
  const lineWidth = 60; // Adjust line length as needed

  // --- DUE DATE ---
  const dueDateY = accountStartY + 24;
  doc.text("Due Date:", leftMargin, dueDateY);
  doc.text("Due Immediately", leftMargin + 40, dueDateY);

  // --- Signatories section ---
  doc.setFont("Helvetica", "bold");
  const signatoryGap = 12; // Vertical spacing
  const nameY1 = dueDateY + signatoryGap + 12; // First row of names

  // Lines above names
  doc.line(leftMargin, nameY1 - 4, leftMargin + lineWidth, nameY1 - 4); // JELLELLE HEREDERO
  doc.line(
    leftMargin + indent + 70,
    nameY1 - 4,
    leftMargin + indent + 70 + lineWidth,
    nameY1 - 4
  ); // AYRA BENIGNO

  doc.text("Prepared by:", leftMargin, dueDateY + signatoryGap);
  doc.text("JELLELLE HEREDERO", leftMargin, nameY1);

  doc.text("Checked by:", leftMargin + indent + 70, dueDateY + signatoryGap);
  doc.text("AYRA BENIGNO", leftMargin + indent + 70, nameY1);

  const nameY2 = nameY1 + 22;

  doc.line(leftMargin, nameY2 - 2, leftMargin + lineWidth, nameY2 - 2); // LEI DE LEON
  doc.line(
    leftMargin + indent + 70,
    nameY2 - 2,
    leftMargin + indent + 70 + lineWidth,
    nameY2 - 2
  ); // SIGNATURE OVER PRINTED NAME

  doc.text("Approved by:", leftMargin, nameY2 - 10);
  doc.text("LEI DE LEON", leftMargin, nameY2 + 2);

  doc.text("Received by:", leftMargin + indent + 70, nameY2 - 10);
  doc.text("SIGNATURE OVER PRINTED NAME", leftMargin + indent + 70, nameY2 + 2);

  doc.save("Billing_Statement_QM_Builders.pdf");
}

function saveForm() {
  const formElements = document.querySelectorAll("input, textarea, select");
  const data = {};

  formElements.forEach(el => {
    if(el.type === "checkbox" || el.type === "radio") {
      data[el.name] = el.checked;
    } else {
      data[el.name] = el.value;
    }
  });

  localStorage.setItem("myFormData", JSON.stringify(data));
}

